const UILabel = "Label";

const MaxVAL = 65534;
const VALNoChange = 65535;
const MaxByte = 255;

const RGBWDim = "rgbw-dim";
const RGBWWhite = "rgbw-white";
const TWDim = "tw-dim";
const Dim = "dim";
const TWTC = "tw-tc";

const delay = (delayInms) => {
